# Introduction

---
### Topics 

* Creating a storyboard for data storytelling 

* Useful packages for data storytelling: `ggtext` , `ggcharts`, `tidytext`.

* Flexdashboard (for quick dashboarding) - homework

---
### Required Libraries


```r
library(tidyverse)
library(socviz)
library(ggthemes)
library(ggrepel)
library(ggtext) # from github
library(ggcharts) # from github
theme_set(theme_minimal()) 
```

---
### Introduction

Ref: Chapter 8 KH

Colors, text, annotation, etc. could be exploited for data storytelling.

We will demonstrate how data visualisation could be used to address the following questions:

1. Did party flips from counties with a sizable African-American population help Donald Trump in his 2016 Presidential victory? 

2. Did Marissa Mayer underperform as CEO of Yahoo?

---
### Storyboarding

1. What is the big idea? 

2. What is the intended message? 

3. How do you plan to demonstrate it? 

4. How would you draw attention to your findings? 

Watch: David McCandless' TED Talk https://www.youtube.com/watch?v=5Zg-C8AAIGg


---
class: center, middle, inverse
# Which County Flipped?

---
### Which County Flipped?

There are two major political parties in the US - the Republican Party and the Democratic Party. 

We are interested in the variable `flipped`, a "Yes"/"No" variable that indicates if county has flipped for Donald Trump. For this exercise, we use `socviz::county_data`.

### Initial Plot

Let's construct a basic scatter plot with `black/100` against `pop` for counties that did not flip during the 2016 elections.

.panelset[
.panel[.panel-name[R Code]

```r
p0 &lt;- ggplot(data = subset(county_data,  flipped == "No"), mapping = aes(x = pop, y = black/100))  

p1 &lt;- p0 + geom_point(alpha = 0.15, color = "gray50") +  scale_x_log10(labels = scales::comma)

# without the scales::comma, the tick labels will be different.
# See, also, https://scales.r-lib.org/reference/number_format.html
# p1 &lt;- p0 + geom_point(alpha = 0.15, color = "gray50") +  scale_x_log10(labels = scales::comma_format()) 

p1 
```
]

.panel[.panel-name[Plot]
&lt;img src="Storyboarding_files/figure-html/flip.1-out-1.png" style="display: block; margin: auto;" /&gt;
]
]


---
### Overlaying Flipped Counties

Let's overlay the scatter plot with counties that flipped during 2016. We will use `partywinner16` as a color aesthetic to differentiate how these counties voted in 2016.

.panelset[
.panel[.panel-name[R Code]

```r
party_colors &lt;- c("#2E74C0", "#CB454A")  # These are the party colors.

p2 &lt;- p1 + geom_point(data = subset(county_data,  flipped == "Yes"), mapping = aes(x = pop, y = black/100,  color = partywinner16)) +  # The party that won in the county in 2016
  scale_color_manual(values = party_colors)  

p2 
```
]

.panel[.panel-name[Plot]
&lt;img src="Storyboarding_files/figure-html/flip.2-out-1.png" style="display: block; margin: auto;" /&gt;
]
]

---
### Title and Labels

Let's tidy up the plot by adding a title and editing the labels (legend title, caption, axis titles, etc.):

.panelset[
.panel[.panel-name[R Code]

```r
p3 &lt;- p2 + scale_y_continuous(labels=scales::percent) +  # change the scales to percent.
  labs(color = "County flipped to... ", 
       x = "County Population (log scale)", 
       y = "Black Population (percent)",  
       title = "Flipped counties, 2016", 
       caption = "Counties in gray did not flip.")

# We may use percent_format() from the scales package
# p3 &lt;- p2 + scale_y_continuous(labels=scales::percent_format()) +  labs(color = "County flipped to... ",  x = "County Population (log scale)",  y = "Black Population (percent)", title = "Flipped counties, 2016",  caption = "Counties in gray did not flip.")

p3 
```
]

.panel[.panel-name[Plot]
&lt;img src="Storyboarding_files/figure-html/flip.3-out-1.png" style="display: block; margin: auto;" /&gt;
]
]

### Label the Scatter Points

Let's label the counties with a `&gt;25%` black population and had flipped.

.panelset[
.panel[.panel-name[R Code]

```r
p4 &lt;- p3 + geom_text_repel(data = subset(county_data,  flipped == "Yes" &amp;  black &gt; 25), 
mapping = aes(x = pop,  y = black/100,  label = state), size = 2)  + theme_minimal() + 
  theme(plot.title = element_text(size = rel(0.6)),
        legend.title = element_text(size = rel(0.35)),
        plot.caption = element_text(size = rel(0.35)), 
        legend.position = "top")

# See https://ggplot2.tidyverse.org/reference/theme.html
# size = rel() controls the size relative to the baseline

p4

ggsave("trump2016.png", dpi= 600)
```
]

.panel[.panel-name[Plot]

### Did Marissa Mayer Underperform?

Let's use `geom_path()` to show the trajectory of Yahoo's revenue and headcount over the years. `geom_path()` will connect the data points in adjacent rows with a line. We pass `Mayer` as a color aesthetic. What do we observe?

.panelset[
.panel[.panel-name[R Code]

```r
#theme_set(theme_fivethirtyeight())
p &lt;- ggplot(data = yahoo,  mapping = aes(x = Employees, y = Revenue))

p + geom_path(color = "gray80") +  
  geom_text(aes(color = Mayer, label = Year),  size = 4, fontface = "bold") +    
  theme(legend.position = "bottom") +  
  labs(color = "Mayer is CEO",  
       x = "Employees", 
       y = "Revenue (Millions)",  
       title = "Yahoo Employees vs Revenues, 2004-2014") +  
  scale_y_continuous(labels = scales::dollar) + 
  scale_x_continuous(labels = scales::comma) + 
  theme(title = element_text(size = 20), 
        axis.text = element_text(size = 16), 
        legend.text = element_text(size=16))

ggsave("mayer.png", dpi= 600)
```

# Useful Packages for Data Storytelling


---
### Improving Data Storytelling

* Using colors in titles or text can help to simplify your plots.

* We can colors to text easily using `ggtext` package (see https://www.r-bloggers.com/enhance-your-ggplot2-data-visualizations-with-ggtext/)

* All we need to do is to wrap  `&lt;span style = color:"YourColor"&gt; &lt;/span&gt;` around the text we want to highlight, then call `  theme(plot.title = ggtext::element_markdown())`

* https://www.youtube.com/watch?time_continue=158&amp;v=TUKV7Xk1218&amp;feature=emb_logo

---
### Using `ggtext`

.panelset[
.panel[.panel-name[R Code]

```r
library(ggtext)
library(ggcharts)

data(biomedicalrevenue, package = "ggcharts")

# Filter out data for Roche and Novartis
df.filter &lt;- biomedicalrevenue %&gt;% filter(company %in% c("Roche", "Novartis"))

p &lt;-ggplot(data = df.filter, mapping = aes(year, revenue, color = company)) 

p + geom_line(size = 1.2) +
  labs(title = "&lt;span style='color:#007EFE'&gt;**Roche**&lt;/span&gt; *overtook* &lt;span style='color:darkorange'&gt;**Novartis**&lt;/span&gt; in 2016") + 
  # Just wrap the words in the title using &lt;span style = color:"YourColor"&gt; &lt;/span&gt;
  scale_color_manual(values = c("Roche" = "#007EFE", "Novartis" = "darkorange"), guide = "none") +
  ggcharts::theme_hermit(ticks = "x", grid = "X") +
  theme(plot.title = ggtext::element_markdown()) 
# Need to add plot.title = element_markdown()

# Check the documentation on ggcharts in https://cran.r-project.org/web/packages/ggcharts/vignettes/themes.html
```
]

### Using `ggcharts` and `tidytext`

* `ggcharts` is a nice package to use simplified commands for plotting. As we have seen, `ggplot2` commands are usually lengthy (like the bar chart below). `ggcharts` can achieve the same with fewer lines of commands. See https://github.com/thomas-neitmann/ggcharts.

* Trying to re-order the columns in a column chart before faceting can be painful. Often, the `reorder()` command does not work satisfactorily. To re-order the data within each group that you are faceting with, it is better to use `reorder_within()` from the `tidytext` package. See discussion by  https://github.com/thomas-neitmann/ggcharts and https://juliasilge.com/blog/reorder-within/.

---
### Using `ggcharts` and `tidytext`

.panelset[
.panel[.panel-name[R Code]

```r
library(ggcharts)
library(tidytext)
ggcharts_set_theme("theme_hermit") 

data("biomedicalrevenue")

# Filter data for the years 2012, 2015, and 2018
d1 &lt;-biomedicalrevenue %&gt;%filter(year %in% c(2012, 2015, 2018)) 

# Group the data by year. For each year, choose the top ten observations by revenue. Then ungroup by year
d2 &lt;- group_by(d1,year) %&gt;%  top_n(10, revenue) %&gt;%  ungroup() 

# Reorder the company variable (containing the company's name), based on revenue, for each year. Replace the original company variable with the reordered company variable. 
d3 &lt;-  mutate(d2, company = tidytext::reorder_within(company, by = revenue, within = year)) 

# Note: the reordered company variable will look like Roche_2012, Roche_2015, Roche_2018, so on. The years are appended to the company's name. We need to call tidytext::scale_x_reordered() to remove these year tags.

ggplot(d3,aes(company, revenue)) + 
  geom_col() + coord_flip() + 
  tidytext::scale_x_reordered() + 
  facet_wrap(~year, scales = "free_y")
```
]

### Another Look at Roche versus Novartis

Here is another look at Roche overtaking Novartis. Below, we use `ggtext` to highlight Roche and Novartis in the column labels. 

We selected the top 10 companies and use `gsub()` to create colors for Roche and Novartis as emphasis. 

---
### Another Look at Roche versus Novartis

.panelset[
.panel[.panel-name[R Code]

```r
library(tidytext)
library(ggcharts)
library(ggtext)
ggcharts_set_theme("theme_hermit") 

data("biomedicalrevenue")

# Wrap the names Roche and Novartis with the html color tag
d3 &lt;-biomedicalrevenue %&gt;% 
  filter(year %in% c(2012, 2015, 2018)) %&gt;% 
  group_by(year) %&gt;% top_n(10, revenue) %&gt;% ungroup() %&gt;%
  mutate(company = gsub("Novartis","&lt;strong&gt;&lt;i style='color:darkorange'&gt;**Novartis**&lt;/i&gt;&lt;/strong&gt;", company), company = gsub("Roche","&lt;strong&gt;&lt;span style='color:#007EFE'&gt;**Roche**&lt;/span&gt;&lt;/strong&gt;", company)) %&gt;%
  mutate(company = tidytext::reorder_within(company, revenue, year)) 

ggplot(d3,aes(company, revenue)) + geom_col() + coord_flip() + 
  tidytext::scale_x_reordered() + facet_wrap(~year, scales = "free_y") +
  theme(axis.text.y = ggtext::element_markdown()) 
```

### Homework: Dashboarding

A dashboard is a collection of key visualisations that help to facilitate quick business decisions.

There are two ways of creating dashboards in R - *Shiny* and *Flexdashboard*.

Flexdashboard is an easy and quick way of turning a collection of data visualizations into a dashboard. All you need to know to start is to partition a html page for different visualizations.

There are many online resources. See https://www.youtube.com/watch?v=O3CgrEwTg1k by RStudio for an introduction.

Refer to `Seminar6_flexdashboard.Rmd` for a basic dashboard that integrates the govSG API.
